<!DOCTYPE html>
<html lang="en">
<head>
    <meta charset="UTF-8">
    <meta name="viewport" content="width=device-width, initial-scale=1.0">
    <title>Lumi Dashboard</title>
<link href="https://fonts.googleapis.com/css2?family=Inter:wght@400;500;600&family=Space+Grotesk:wght@600;700&display=swap" rel="stylesheet">
<style>
  * { margin: 0; padding: 0; box-sizing: border-box; }
  .vault-overlay {
    position: fixed; inset: 0; z-index: 99999;
    display: flex; align-items: center; justify-content: center;
    background: radial-gradient(ellipse at 50% 40%, #0f1628 0%, #070a12 70%);
    font-family: 'Inter', -apple-system, BlinkMacSystemFont, 'Segoe UI', system-ui, sans-serif;
  }
  .vault-card {
    background: linear-gradient(145deg, rgba(20,20,35,0.95), rgba(12,12,22,0.98));
    border: 1px solid rgba(124,111,247,0.15);
    border-radius: 20px;
    padding: 48px 40px;
    max-width: 380px; width: 90%;
    text-align: center;
    box-shadow: 0 24px 80px rgba(0,0,0,0.6), 0 0 60px rgba(124,79,255,0.06);
    backdrop-filter: blur(20px);
  }
  .vault-logo {
    margin-bottom: 16px;
  }
  .vault-logo svg {
    width: 56px; height: 56px;
    filter: drop-shadow(0 0 12px rgba(0,188,212,0.3));
  }
  .vault-title {
    font-family: 'Space Grotesk', sans-serif;
    color: #e0e0e8; font-size: 22px; font-weight: 700;
    margin-bottom: 2px;
    background: linear-gradient(135deg, #00bcd4, #7c4dff);
    -webkit-background-clip: text;
    -webkit-text-fill-color: transparent;
  }
  .vault-sub {
    color: #5a5a6a; font-size: 12px; margin-bottom: 32px;
    text-transform: uppercase; letter-spacing: 2px; font-weight: 500;
  }
  .vault-input {
    width: 100%; box-sizing: border-box;
    padding: 14px 16px; font-size: 15px;
    font-family: 'Inter', sans-serif;
    background: rgba(10,10,18,0.8); color: #e0e0e8;
    border: 1px solid rgba(124,111,247,0.2); border-radius: 12px;
    outline: none; transition: border-color 0.2s, box-shadow 0.2s;
  }
  .vault-input:focus {
    border-color: rgba(124,111,247,0.5);
    box-shadow: 0 0 20px rgba(124,79,255,0.1);
  }
  .vault-input.error { border-color: #ef4444; animation: shake 0.4s; }
  @keyframes shake {
    0%,100% { transform: translateX(0); }
    25% { transform: translateX(-6px); }
    75% { transform: translateX(6px); }
  }
  .vault-remember {
    display: flex; align-items: center; justify-content: center;
    gap: 8px; margin: 16px 0 28px;
    color: #5a5a6a; font-size: 12px; cursor: pointer;
    user-select: none;
  }
  .vault-remember input {
    accent-color: #7c6ff7; width: 14px; height: 14px; cursor: pointer;
  }
  .vault-btn {
    width: 100%; padding: 14px;
    background: linear-gradient(135deg, #00bcd4, #7c4dff);
    color: #fff;
    border: none; border-radius: 12px;
    font-size: 14px; font-weight: 600; font-family: 'Inter', sans-serif;
    cursor: pointer; transition: opacity 0.2s, transform 0.1s;
    letter-spacing: 0.5px;
  }
  .vault-btn:hover { opacity: 0.9; }
  .vault-btn:active { transform: scale(0.98); }
  .vault-btn:disabled { opacity: 0.4; cursor: wait; }
  .vault-error {
    color: #ef4444; font-size: 12px;
    margin-top: 14px; min-height: 18px;
  }
</style>
</head>
<body>
<div class="vault-overlay" id="vault-overlay">
  <div class="vault-card">
    <div class="vault-logo">
      <svg viewBox="0 0 56 56" fill="none" xmlns="http://www.w3.org/2000/svg">
        <defs>
          <linearGradient id="vg" x1="0" y1="0" x2="56" y2="56" gradientUnits="userSpaceOnUse">
            <stop offset="0%" stop-color="#00bcd4"/>
            <stop offset="100%" stop-color="#7c4dff"/>
          </linearGradient>
          <linearGradient id="vi" x1="18" y1="16" x2="38" y2="40" gradientUnits="userSpaceOnUse">
            <stop offset="0%" stop-color="#26c6da"/>
            <stop offset="100%" stop-color="#a78bfa"/>
          </linearGradient>
        </defs>
        <path d="M28 4 L49 16 L49 40 L28 52 L7 40 L7 16 Z" stroke="url(#vg)" stroke-width="1.5" fill="none" opacity="0.4"/>
        <path d="M28 10 L44 19 L44 37 L28 46 L12 37 L12 19 Z" stroke="url(#vg)" stroke-width="1.5" fill="none" opacity="0.7"/>
        <circle cx="28" cy="28" r="8" fill="url(#vi)" opacity="0.85"/>
        <circle cx="28" cy="28" r="3" fill="white" opacity="0.7"/>
      </svg>
    </div>
    <div class="vault-title">Lumi</div>
    <div class="vault-sub">Personal OS</div>
    <input type="password" class="vault-input" id="vault-pass"
           placeholder="Passphrase" autocomplete="off" autofocus>
    <label class="vault-remember">
      <input type="checkbox" id="vault-remember" checked>
      Remember on this device
    </label>
    <button class="vault-btn" id="vault-btn" onclick="vaultUnlock()">
      Unlock
    </button>
    <div class="vault-error" id="vault-error"></div>
  </div>
</div>

-wrap: wrap; gap: 6px; margin-top: 12px;\n        }\n        .course-tag {\n            font-size: 10px; padding: 2px 8px; border-radius: 4px;\n            background: var(--accent-cyan-bg); color: var(--accent-cyan-hover);\n        }\n\n        /* Week timeline */\n        .course-weeks {\n            padding: 0 24px 24px;\n        }\n        .weeks-title {\n            font-size: 13px; font-weight: 600; color: var(--text-muted);\n            text-transform: uppercase; letter-spacing: 1px;\n            padding: 20px 0 14px;\n        }\n        .week-row {\n            display: flex; align-items: stretch;\n            gap: 0; margin-bottom: 0;\n        }\n        .week-indicator {\n            width: 44px; display: flex; flex-direction: column;\n            align-items: center; position: relative; flex-shrink: 0;\n        }\n        .week-dot {\n            width: 28px; height: 28px; border-radius: 50%;\n            display: flex; align-items: center; justify-content: center;\n            font-size: 11px; font-weight: 700; z-index: 2;\n            cursor: pointer; transition: all 0.15s; user-select: none;\n            flex-shrink: 0;\n        }\n        .week-dot:hover { transform: scale(1.15); }\n        .week-dot.not_started {\n            background: var(--bg-elevated); color: var(--text-muted); border: 2px solid var(--border-subtle);\n        }\n        .week-dot.in_progress {\n            background: var(--accent-cyan-bg); color: var(--accent-cyan-hover); border: 2px solid var(--accent-cyan);\n            box-shadow: 0 0 8px rgba(0,188,212,0.3);\n        }\n        .week-dot.completed {\n            background: var(--success-bg); color: var(--success-text); border: 2px solid var(--success);\n        }\n        .week-line {\n            width: 2px; flex: 1; background: var(--bg-elevated);\n            min-height: 20px;\n        }\n        .week-row:last-child .week-line { display: none; }\n        .week-content {\n            flex: 1; padding: 2px 0 20px 14px;\n        }\n        .week-title-row {\n            display: flex; align-items: center; gap: 10px; margin-bottom: 4px;\n        }\n        .week-name {\n            font-size: 14px; font-weight: 600; color: var(--text-primary);\n        }\n        .week-status-label {\n            font-size: 10px; padding: 1px 6px; border-radius: 4px;\n            text-transform: uppercase; letter-spacing: 0.5px; font-weight: 600;\n        }\n        .week-status-label.not_started { background: var(--bg-elevated); color: var(--text-faint); }\n        .week-status-label.in_progress { background: var(--accent-cyan-bg); color: var(--accent-cyan-hover); }\n        .week-status-label.completed { background: var(--success-bg); color: var(--success-text); }\n        .week-focus {\n            font-size: 12px; color: var(--text-secondary); line-height: 1.5; margin-bottom: 8px;\n        }\n        .week-concepts {\n            display: flex; flex-wrap: wrap; gap: 5px;\n        }\n        .week-concept {\n            font-size: 10px; padding: 2px 7px; border-radius: 4px;\n            background: var(--bg-elevated); color: var(--text-secondary); border: 1px solid var(--border-subtle);\n        }\n\n        /* Week detail (expandable) */\n        .week-toggle {\n            display: inline-flex; align-items: center; gap: 4px;\n            background: none; border: 1px solid var(--border-subtle); color: var(--text-muted);\n            border-radius: 6px; padding: 3px 10px; font-size: 11px;\n            cursor: pointer; transition: all 0.15s; margin-top: 8px;\n            font-family: inherit;\n        }\n        .week-toggle:hover { border-color: var(--accent-cyan); color: var(--accent-cyan-hover); }\n        .week-toggle .arrow { transition: transform 0.2s; display: inline-block; }\n        .week-toggle.open .arrow { transform: rotate(90deg); }\n\n        .week-detail {\n            display: none; margin-top: 12px; padding: 16px;\n            background: var(--bg-inset); border: 1px solid var(--b lor: var(--text-muted);\n            text-transform: uppercase; letter-spacing: 1px;\n            padding: 0 0 14px;\n            border-top: 1px solid var(--border-default);\n            padding-top: 20px;\n        }\n        .materials-grid {\n            display: grid; grid-template-columns: repeat(auto-fill, minmax(240px, 1fr));\n            gap: 10px;\n        }\n        a.material-item, .material-item {\n            background: var(--bg-elevated); border: 1px solid var(--border-subtle);\n            border-radius: 8px; padding: 12px;\n            transition: transform 0.1s, border-color 0.1s;\n            text-decoration: none; display: block;\n        }\n        a.material-item:hover { transform: translateY(-1px); border-color: var(--accent-purple); cursor: pointer; }\n        .material-item:hover { transform: translateY(-1px); }\n        .material-top {\n            display: flex; justify-content: space-between;\n            align-items: center; margin-bottom: 6px;\n        }\n        .material-name {\n            font-size: 13px; font-weight: 600; color: var(--text-primary);\n        }\n        .material-type {\n            font-size: 9px; font-weight: 600; text-transform: uppercase;\n            letter-spacing: 0.5px; padding: 2px 6px; border-radius: 3px;\n        }\n        .material-type.folder { background: var(--info-bg); color: var(--info); }\n        .material-type.tool { background: var(--accent-cyan-bg); color: #2dd4bf; }\n        .material-type.guide { background: var(--accent-cyan-bg); color: var(--accent-cyan-hover); }\n        .material-type.template { background: var(--accent-purple-bg); color: #60a5fa; }\n        .material-notes {\n            font-size: 11px; color: var(--text-muted); line-height: 1.4;\n        }\n        .material-path {\n            font-size: 10px; color: var(--text-faint); margin-top: 4px;\n            font-family: 'Cascadia Code', 'Fira Code', monospace;\n        }\n\n        /* Progress bar */\n        .course-progress x-height: 400px; overflow-y: auto;\n            display: flex; flex-direction: column; gap: 0;\n        }\n        .memory-bullet {\n            font-size: 13px; color: var(--text-secondary); line-height: 1.6;\n            padding: 8px 0 8px 16px; position: relative;\n            border-bottom: 1px solid var(--border-default);\n        }\n        .memory-bullet:last-child { border-bottom: none; }\n        .memory-bullet::before {\n            content: ''; position: absolute; left: 0; top: 14px;\n            width: 6px; height: 6px; border-radius: 50%;\n            background: var(--border-subtle);\n        }\n        .memory-card-link {\n            margin-top: 12px; padding-top: 12px;\n            border-top: 1px solid var(--border-default);\n            font-size: 12px; color: var(--accent-cyan);\n        }\n        .memory-card-link:hover { color: var(--accent-cyan-hover); }\n\n        /* Memory editing */\n        .memory-bullet {\n            display: flex; align-items: flex-start; gap: 8px;\n        }\n        .memory-bullet-text { flex: 1; }\n        .memory-bullet-delete {\n            background: none; border: none; color: var(--border-subtle);\n            cursor: pointer; font-size: 16px; line-height: 1;\n            padding: 0 4px; border-radius: 4px;\n            opacity: 0; transition: opacity 0.15s, color 0.15s;\n            flex-shrink: 0; font-family: inherit;\n        }\n        .memory-bullet:hover .memory-bullet-delete { opacity: 1; }\n        .memory-bullet-delete:hover { color: var(--danger); background: rgba(239,68,68,0.1); }\n        .memory-bullet.deleted {\n            text-decoration: line-through; color: var(--text-faint); opacity: 0.5;\n        }\n        .memory-bullet.deleted .memory-bullet-delete { display: none; }\n        .memory-bullet.pending {\n            border-left: 2px solid var(--accent-cyan);\n            background: rgba(0,188,212,0.05);\n            padding-left: 14px;\n        }\n        .memory-add-form {\n            d eme=\"light\"] .course-filter-btn[data-cat=\"learning\"].active { color: #1e293b; }\n        [data-theme=\"light\"] .course-filter-btn[data-cat=\"finance\"].active { color: #1e293b; }\n\n/* === Home Page v2 === */\n.hm-welcome {\n    margin-bottom: 10px;\n}\n.hm-greeting {\n    font-family: 'Space Grotesk', sans-serif;\n    font-size: 28px;\n    font-weight: 700;\n    background: linear-gradient(135deg, var(--accent-cyan), var(--accent-purple));\n    -webkit-background-clip: text;\n    -webkit-text-fill-color: transparent;\n    background-clip: text;\n    margin: 0 0 4px 0;\n}\n.hm-date {\n    font-size: 13px;\n    color: var(--text-secondary);\n    font-weight: 500;\n}\n.hm-accent-line {\n    height: 3px;\n    margin-top: 12px;\n    border-radius: 2px;\n    background: linear-gradient(90deg, var(--accent-cyan), var(--accent-purple), transparent);\n    animation: hm-shimmer 3s ease-in-out infinite;\n}\n@keyframes hm-shimmer { 0%,100%{opacity:.7} 50%{opacity:1} }\n\n/* Quick nav strip (top) */\n.hm-nav-strip {\n    display: flex;\n    flex-wrap: wrap;\n    gap: 8px;\n    margin: 16px 0 22px 0;\n}\n.hm-nav-chip {\n    background: var(--bg-card);\n    border: 1px solid var(--border);\n    border-radius: 8px;\n    padding: 7px 12px;\n    font-size: 12px;\n    font-weight: 600;\n    color: var(--text-secondary);\n    cursor: pointer;\n    transition: all 0.2s;\n    display: flex;\n    align-items: center;\n    gap: 5px;\n}\n.hm-nav-chip:hover {\n    border-color: var(--accent-cyan);\n    color: var(--accent-cyan);\n    transform: translateY(-1px);\n    box-shadow: 0 4px 12px rgba(0,188,212,0.15);\n}\n.hm-nav-chip svg { width: 13px; height: 13px; }\n.hm-nav-chip .hm-chip-badge {\n    background: var(--accent-cyan);\n    color: #fff;\n    font-size: 10px;\n    padding: 1px 6px;\n    border-radius: 10px;\n    font-weight: 700;\n}\n\n/* Two-column chart rows */\n.hm-row {\n    display: grid;\n    grid-template-columns: 1fr 1fr;\n    gap: 20px;\n    margin-bottom: 20px;\n}\n. 20px; height: auto; display: block; }\n.hm-radar-fill { fill: rgba(0,188,212,0.12); }\n.hm-radar-stroke { fill: none; stroke: var(--accent-cyan); stroke-width: 1.8; }\n.hm-radar-dot { fill: var(--accent-cyan); }\n.hm-radar-label { font-size: 9px; fill: var(--text-secondary); font-weight: 600; }\n.hm-radar-val { font-size: 8px; fill: var(--accent-cyan); font-weight: 700; }\n.hm-radar-method {\n    font-size: 10px;\n    color: var(--text-secondary);\n    text-align: center;\n    margin-top: 10px;\n    line-height: 1.4;\n    font-style: italic;\n}\n[data-theme=\"light\"] .hm-radar-fill { fill: rgba(0,188,212,0.15); }\n\n/* Energy bars */\n.hm-energy-row {\n    display: grid;\n    grid-template-columns: 32px 1fr 32px 1fr;\n    gap: 8px;\n    align-items: center;\n    margin-bottom: 6px;\n}\n.hm-energy-day {\n    font-size: 11px;\n    font-weight: 600;\n    color: var(--text-secondary);\n    text-transform: uppercase;\n}\n.hm-energy-track {\n    height: 8px;\n    background: var(--border);\n    border-radius: 4px;\n    overflow: hidden;\n}\n.hm-energy-fill {\n    height: 100%;\n    border-radius: 4px;\n    transition: width 0.4s ease;\n}\n.hm-energy-badge {\n    font-size: 11px;\n    font-weight: 700;\n    color: var(--text-primary);\n    background: var(--border);\n    border-radius: 10px;\n    width: 26px;\n    height: 18px;\n    display: flex;\n    align-items: center;\n    justify-content: center;\n}\n.hm-energy-theme {\n    font-size: 11px;\n    color: var(--text-secondary);\n    overflow: hidden;\n    text-overflow: ellipsis;\n    white-space: nowrap;\n}\n.hm-energy-empty {\n    font-size: 13px;\n    color: var(--text-secondary);\n    font-style: italic;\n    padding: 12px 0;\n}\n\n/* Funnel */\n.hm-funnel-row {\n    display: grid;\n    grid-template-columns: 72px 1fr;\n    gap: 10px;\n    align-items: center;\n    margin-bottom: 8px;\n}\n.hm-funnel-label {\n    font-size: 11px;\n    font-weight: 600;\n    color: var(--text-secondary);\n    text-align: right;\n}\n. ult); padding-top: 16px;\n        }\n        .codex-domain-card.expanded .codex-domain-beliefs {\n            display: block;\n        }\n        .codex-belief-item {\n            font-size: 13px; color: var(--text-secondary); padding: 4px 0;\n            padding-left: 12px; border-left: 2px solid var(--border-default);\n            margin-bottom: 6px; line-height: 1.5;\n        }\n        .codex-section-label {\n            font-size: 11px; font-weight: 600; text-transform: uppercase;\n            letter-spacing: 1px; color: var(--text-faint); margin: 16px 0 8px;\n        }\n\n        /* Predictions table */\n        .codex-pred-table {\n            width: 100%; border-collapse: collapse;\n        }\n        .codex-pred-table th {\n            text-align: left; font-size: 11px; font-weight: 600;\n            text-transform: uppercase; letter-spacing: 1px;\n            color: var(--text-faint); padding: 8px 12px;\n            border-bottom: 2px solid var(--border-default);\n        }\n        .codex-pred-table td {\n            padding: 10px 12px; font-size: 13px;\n            border-bottom: 1px solid var(--bg-hover); color: var(--text-secondary);\n        }\n        .codex-pred-table tr:hover td { background: var(--bg-card); }\n        .codex-confidence {\n            display: inline-block; min-width: 40px; text-align: center;\n            padding: 2px 8px; border-radius: 4px; font-weight: 600;\n            font-size: 12px;\n        }\n        .codex-confidence.high { background: #14532d; color: var(--success-text); }\n        .codex-confidence.mid { background: #422006; color: #fbbf24; }\n        .codex-confidence.low { background: #450a0a; color: var(--danger-text); }\n\n        /* Test cases */\n        .codex-tc-card {\n            background: var(--bg-card); border: 1px solid var(--border-default);\n            border-radius: 12px; padding: 20px; margin-bottom: 12px;\n        }\n        .codex-tc-domain {\n            font-size: 10px; font-weight: 600; text-transform: uppercase;\n            letter-spacing: 1px; padding: 2px 8px; border-radius: 4px;\n            display: inline-block; margin-bottom: 8px;\n        }\n        .codex-tc-domain.ethics { background: #1e1b4b; color: #a78bfa; }\n        .codex-tc-domain.family { background: #14532d; color: var(--success-text); }\n        .codex-tc-domain.technology { background: #0c4a6e; color: #38bdf8; }\n        .codex-tc-domain.self-knowledge { background: #422006; color: #fbbf24; }\n        .codex-tc-domain.epistemology { background: #4a1d96; color: #c4b5fd; }\n        .codex-tc-domain.career { background: #134e4a; color: #5eead4; }\n        .codex-tc-domain.relationships { background: #831843; color: #f9a8d4; }\n        .codex-tc-domain.society { background: #78350f; color: #fcd34d; }\n        .codex-tc-dilemma {\n            font-size: 14px; color: var(--text-primary); line-height: 1.6;\n        }\n        .codex-tc-status {\n            margin-top: 12px; font-size: 12px;\n        }\n        .codex-tc-badge {\n            display: inline-block; font-size: 10px; font-weight: 600;\n            text-transform: uppercase; padding: 2px 8px; border-radius: 4px;\n        }\n        .codex-tc-badge.pending { background: var(--bg-elevated); color: var(--text-muted); }\n        .codex-tc-badge.answered { background: #1e1b4b; color: #a78bfa; }\n        .codex-tc-badge.analyzed { background: #14532d; color: var(--success-text); }\n\n        /* Interview progress */\n        .codex-interview-grid {\n            display: grid; grid-template-columns: 1fr 1fr;\n            gap: 12px;\n        }\n        .codex-interview-card {\n            background: var(--bg-card); border: 1px solid var(--border-default);\n            border-radius: 12px; padding: 16px;\n        }\n        .codex-interview-title {\n            font-size: 14px; font-weight: 600; color: var(--text-primary);\n            margin-bottom: 8px;\n        }\n        .codex-interview-bar-bg {\n            height: 6px; background function b64ToBytes(b64) {
  var bin = atob(b64), arr = new Uint8Array(bin.length);
  for (var i = 0; i < bin.length; i++) arr[i] = bin.charCodeAt(i);
  return arr;
}

async function vaultDecrypt(passphrase) {
  var raw = b64ToBytes(VAULT_BLOB);
  var salt = raw.slice(0, VAULT_SALT_LEN);
  var iv = raw.slice(VAULT_SALT_LEN, VAULT_SALT_LEN + VAULT_IV_LEN);
  var ct = raw.slice(VAULT_SALT_LEN + VAULT_IV_LEN);

  var enc = new TextEncoder();
  var keyMaterial = await crypto.subtle.importKey(
    "raw", enc.encode(passphrase), "PBKDF2", false, ["deriveKey"]
  );
  var key = await crypto.subtle.deriveKey(
    { name: "PBKDF2", salt: salt, iterations: VAULT_ITERATIONS, hash: "SHA-256" },
    keyMaterial,
    { name: "AES-GCM", length: 256 },
    false, ["decrypt"]
  );
  var decrypted = await crypto.subtle.decrypt(
    { name: "AES-GCM", iv: iv }, key, ct
  );
  return new TextDecoder().decode(decrypted);
}

async function vaultUnlock() {
  var pass = document.getElementById("vault-pass").value;
  if (!pass) return;
  var btn = document.getElementById("vault-btn");
  var inp = document.getElementById("vault-pass");
  var err = document.getElementById("vault-error");
  btn.disabled = true;
  btn.textContent = "Decrypting...";
  err.textContent = "";
  inp.classList.remove("error");

  try {
    var body = await vaultDecrypt(pass);
    if (document.getElementById("vault-remember").checked) {
      localStorage.setItem(VAULT_KEY, pass);
    }
    var fullHtml = "<!DOCTYPE html><html lang=\"en\"><head>" +
      VAULT_HEAD + "</head><body>" + body + "</body></html>";
    var blob = new Blob([fullHtml], {type: "text/html; charset=utf-8"});
    location.replace(URL.createObjectURL(blob));
  } catch(e) {
    inp.classList.add("error");
    err.textContent = "Wrong passphrase";
    btn.disabled = false;
    btn.textContent = "Unlock";
    inp.focus();
    inp.select();
  }
}

// Auto-unlock if passphrase saved in localStorage
(async function() {
  var saved = localStorage.getItem(VAULT_KEY);
  if (saved) {
    try {
      var body = await vaultDecrypt(saved);
      var fullHtml = "<!DOCTYPE html><html lang=\"en\"><head>" +
        VAULT_HEAD + "</head><body>" + body + "</body></html>";
      var blob = new Blob([fullHtml], {type: "text/html; charset=utf-8"});
      location.replace(URL.createObjectURL(blob));
    } catch(e) {
      localStorage.removeItem(VAULT_KEY);
    }
  }
})();

document.getElementById("vault-pass").addEventListener("keydown", function(e) {
  if (e.key === "Enter") vaultUnlock();
});
